import React from 'react';
import "../components/freefire.css";

const cardData = [
  { id: 1, className: 'freefire-card-1', imageUrl: '../Images/freefire.png' },
  { id: 2, className: 'freefire-card-2', imageUrl: '../Images/freefire.png' },
  { id: 3, className: 'freefire-card-3', imageUrl: '../Images/freefire.png' },
  { id: 4, className: 'freefire-card-4', imageUrl: 'path/to/image4.jpg' },
];

export function Freefire() {
  return (
    <>
      <div className="card-container">
        {cardData.map((card) => (
          <div key={card.id} className={card.className}>
            <img src={card.imageUrl} alt="Card" />
          </div>
        ))}
      </div>
    </>
  );
}
